import React from 'react';

const Resume = () => {
    return (
        <div className="page-section resume-section">
            <h2 className="section-title">Resume</h2>
            <div className="resume-container">
                {/* Header Section */}
                <div className="resume-header">
                    <h3>Kishan Patel</h3>
                    <p>MCA Student | Full-Stack Developer</p> {/*  */}
                    <small>
                        MCA student with skills in <b>Java, JavaScript, and Python</b>, 
                        experienced in building responsive web applications using 
                        <b>HTML, CSS, and React.js</b>. Familiar with MySQL, DSA, GitHub, Power BI, and Excel, 
                        and eager to apply skills in real-world projects. 
                    </small>
                </div>

                {/* Education Section */}
                <div className="resume-block">
                    <h4>Education</h4>
                    <div className="school">
                        <h5>Master of Computer Application (M.C.A.)</h5>
                        <small>Parul University | 2024 – 2026</small> {/* [cite: 5, 6] */}
                        <small>CGPA: 7.96/10</small> {/* [cite: 7] */}
                    </div>
                    <br />
                    <div className="school">
                        <h5>Bachelor of Commerce</h5>
                        <small>Shri V R Patel College of Commerce, Mehsana | 2022 – 2024</small> {/* [cite: 8, 9] */}
                        <small>CGPA: 7.34/10</small> {/* [cite: 10] */}
                    </div>
                    <br />
                    <div className="school">
                        <h5>HSC (12th) - GSHSEB</h5>
                        <small>Sheth MRS High School, Unjha | 2021</small> {/* [cite: 11, 12] */}
                        <small>Percentage: 61.71%</small> {/* [cite: 13] */}
                    </div>
                </div>

                {/* Projects Section (Styled as Experience/Job) */}
                <div className="resume-block">
                    <h4>Projects</h4>
                    
                    <div className="job">
                        <h5>Online Vehicle Service Booking System</h5>
                        <small>TechnoPython (Flask), HTML, CSS, JavaScript, MySQL, Firebase</small> {/* [cite: 28, 31] */}
                        <p>Developed a web-based system allowing users to book vehicle services and track status. 
                           Implemented secure user authentication and real-time data management.
                        </p> {/* [cite: 29, 30, 31] */}
                    </div>

                    <div className="job">
                        <h5>Online GYM Booking System</h5>
                        <small>HTML, CSS, JavaScript</small> {/* [cite: 33, 34] */}
                        <p>Designed a responsive, user-friendly gym website showcasing services, workout plans, and membership details.</p> {/* [cite: 35, 36] */}
                    </div>

                    <div className="job">
                        <h5>Personal Portfolio</h5>
                        <small>HTML, CSS</small> {/* [cite: 23] */}
                        <p>Developed and deployed a responsive personal portfolio to showcase projects, certifications, and GitHub links.</p> {/* [cite: 24, 25, 26] */}
                    </div>
                </div>

                {/* Skills Section */}
                <div className="resume-block">
                    <h4>Skills</h4>
                    <div className="school"> {/* reusing school class for tight spacing */}
                        <p><strong>Programming:</strong> Java, JavaScript, Python, OOPs</p> {/* [cite: 18] */}
                        <p><strong>Web:</strong> HTML, CSS, React.js</p> {/* [cite: 19] */}
                        <p><strong>Databases & Tools:</strong> MySQL, GitHub, Power BI, Excel</p> {/* [cite: 20, 21] */}
                    </div>
                </div>

                {/* Certificates Section */}
                <div className="resume-block">
                    <h4>Certificates</h4>
                    <div className="school">
                        <p>• Java, Python</p> {/* [cite: 39] */}
                        <p>• Computer Network</p> {/* [cite: 40] */}
                        <p>• Data Science Using Python, Exploratory Data Analysis</p> {/* [cite: 41] */}
                    </div>
                </div>

                <button className="btn primary" onClick={() => window.print()}>Download PDF</button>
            </div>
        </div>
    );
};

export default Resume;
